import { useTranslation } from "react-i18next"

const RealEstate = () => {
    const { t, i18n } = useTranslation();
    return(
        <div className="wrap">
            <div className="real-estate">
                <div className="title">{t("estate-title")}</div>
            </div>
        </div>
    )
}

export default RealEstate;
